import React from "react";
import { Card } from "../../Card.styled";
const SectionSix = () => {
  return (
    <>
      <Card bd={"1px solid red"} height={"25rem"}>
        <Card
          ps={"relative"}
          pstp={"27%"}
          pslf={"30%"}
          bd={"1px solid blue"}
          width={"40%"}
          height={"40%"}
        >
          <Card mg={"auto"}>Join Our</Card>
          <Card>Community.</Card>
          <Card>
            <p>
              Meet the A. Community, artistsand collectors for platform updates,
              announcements, and more....
            </p>
          </Card>
        </Card>
      </Card>
    </>
  );
};

export default SectionSix;
